import EmploymentDetailsForm from './EmploymentDetailsForm';

function EmploymentDetails() {
  return (
    <HeaderForm title="Employment Details">
      <EmploymentDetailsForm />
    </HeaderForm>
  );
}

export default EmploymentDetails;
